import React from "react";

const Laps=(props)=>{
    return(
        <ul className="list-group list-group-item">
            {props.laps.map(lap => {
                return(
                    <li className="list-group-item">
                        {lap.time.min}
                    </li>
                );
            })}
        </ul>
    );
};

export default Laps;
